import React from 'react';
import personalInfo from '../personal/info.json';

const Links = () => {
    const { links, email, phone } = personalInfo;

    return (
        <div className="container text-center contact-section">
            <h2>Contact Me</h2>
            <p>If you'd like to get in touch, feel free to use the details below:</p>
            <div className="contact-links">
                {/* LinkedIn */}
                <a href={links.linkedin} target="_blank" rel="noopener noreferrer" className="btn btn-link">
                    <i className="fab fa-linkedin fa-2x"></i>
                </a>
                {/* GitHub */}
                <a href="https://github.com/Gunamvn" target="_blank" rel="noopener noreferrer" className="btn btn-link">
                    <i className="fab fa-github fa-2x"></i>
                </a>
                {/* Gmail */}
                <a href={`mailto:${email}`} className="btn btn-link">
                    <i className="fas fa-envelope fa-2x"></i>
                </a>
                {/* Phone */}
                <a href={`tel:${phone}`} className="btn btn-link">
                    <i className="fas fa-phone fa-2x"></i>
                </a>
            </div>
            <div className="contact-info">
                <p>Email: <a href={`mailto:${email}`}>{email}</a></p>
                <p>Phone: <a href={`tel:${phone}`}>{phone}</a></p>
                <p>Availability: Monday to Friday: 9 AM - 6 PM</p>
            </div>
        </div>
    );
};

export default Links;
